import React from 'react';
import Header from './Header';
import Logo from './Logo';
import Footer from './Footer';

function AboutUs() {
  return (
    <div className="about-us-container">
      <Header />
      
      <div className="container">
        {/* Title */}
        <h1 className="text-center my-4">About Us</h1>

        {/* Little Logo */}
        <LittleLogo />

        {/* Pioneering the Future of Security Section */}
        <section className="pioneering-section">
          {/* Content for "Pioneering the Future of Security" */}
        </section>

        {/* Redefining Security in Canada Section */}
        <section className="redefining-section">
          {/* Content for "Redefining Security in Canada" */}
        </section>

        {/* Elevating Security with Integrity Section */}
        <section className="elevating-section">
          {/* Content for "Elevating Security with Integrity" */}
        </section>
      </div>

      <Footer />
    </div>
  );
}

export default AboutUs;
